import React from 'react';

function FlashcardNavigation({ onNext, onPrev }) {
  return (
    <div className="navigation">
      <button onClick={onPrev}>Previous</button>
      <button onClick={onNext}>Next</button>
    </div>
  );
}

export default FlashcardNavigation;
